CREATE VIEW allemitarbeiter AS 
select mitarbeiter.PIN AS PIN,
       mitarbeiter.GEHALTSSTUFE_ID AS GEHALTSSTUFE_ID,
       mitarbeiter.KUERZEL AS KUERZEL,
       mitarbeiter.TITEL AS TITEL,
       assistent.AUFGABE_ID AS AUFGABE_ID,
       assistent.BEFRISTUNG AS BEFRISTUNG 
from (mitarbeiter join assistent on((mitarbeiter.PIN = assistent.PIN))) 
union 
select mitarbeiter.PIN AS PIN,
       mitarbeiter.GEHALTSSTUFE_ID AS GEHALTSSTUFE_ID,
       mitarbeiter.KUERZEL AS KUERZEL,
       mitarbeiter.TITEL AS TITEL,
       sonst_mit.AUFGABE_ID AS AUFGABE_ID,
       NULL AS Befristung 
       from (mitarbeiter join sonst_mit on((mitarbeiter.PIN = sonst_mit.PIN)));


CREATE VIEW veranst_pro_tag AS 
       select 
       	      t.WOCHENTAG AS wochentag,
       	      count(v.VERANSTALTUNG_ID) AS anzahl_veranst 
       from (tag t join veranstaltung v) 
       where v.VERANSTALTUNG_ID in 
       	     (select vt.VERANSTALTUNG_ID 
	      from (termin join veranst_termin vt on((termin.TERMIN_ID = vt.TERMIN_ID))) 
	      where (termin.TAG = t.TAG) group by vt.VERANSTALTUNG_ID) 
       group by t.WOCHENTAG;

CREATE VIEW view_raumauslastung AS 
       select raum.RAUM_BEZ AS raum_bez,(count(distinct termin.TAG ||'|'|| termin.BLOCK) * 100.0 / (select count(0) from termin)) AS Prozent 
       from ((raum join veranst_termin on((raum.RAUM_ID = veranst_termin.RAUM_ID))) join termin on((veranst_termin.TERMIN_ID = termin.TERMIN_ID))) 
       group by raum.RAUM_BEZ 
       having ((count(distinct termin.TAG ||'|'|| termin.BLOCK) * 100.0 / (select count(0) from termin)) > 25.0);